tinymce.PluginManager.add("wfc_doc", function (e, t) {

    function n()
    {
        e.windowManager.open({
            title: "WFC DOC",
            bodyType: "tabpanel",
            body: {
                title: "General",
                type: "form"
            }
        });
    }
    t.addButton("wfc_doc", {
        type: "panelbutton",
        panel: {
            autohide: !0,
            html: n
        },
        tooltip: "WFC DOC"
    });
});